# process-mrva-results 0.0.1
extensions:
- addsTo:
    extensible: typeModel
    pack: codeql/python-all
  data:
  - - flask.Response~Subclass
    - translatepy
    - Member[server].Member[translation].Member[FlaskResponse]
  - - io.StringIO~Subclass
    - translatepy
    - Member[models].Member[BytesIO]
